// import './App.css';
import jsonData from "./MOCK_DATA.json";
function App() {
  return (
    <div className="App">
     <input type="text" placeholder="search..."/>
     {jsonData.map((val,key)=>{
      return <div className="user" key="ke">
        {val.first_name}
      </div>
    })}
    </div>
  );
}

export default App;
